import FirstBlogPost from '../posts/sample.md';
import FirstBlogPostImage from '../assets/img/client_1.png'

const Posts = [
    {
        title: "I'm a cool blog post, check me out.",
        date: "January 4, 2021",
        image: FirstBlogPostImage,
        content: FirstBlogPost,
        route: "cool-blog-post"
    },
    {
        title: "I'm a different blog post, check me out later.",
        date: "January 7, 2021",
        image: FirstBlogPostImage,
        content: FirstBlogPost,
        route: "check-me-out"
    },
]

export default Posts;
